export enum Screens {
  TodoDetails = "TODO_DETAILS",
  TodoList = "TODO_LIST",
}

export interface ScreenOptions {
  name: Screens,
  subTitle: string
}

export interface Screen extends ScreenOptions {
  component: React.Component,
}
